    var image = new Image();
    image.src = "data:image/png;base64,";

    var createGLTexture = function (gl, image, flipY) {
        var texture = gl.createTexture();
        gl.bindTexture(gl.TEXTURE_2D, texture);
        if(flipY){
            gl.pixelStorei(gl.UNPACK_FLIP_Y_WEBGL, true);
        }
        gl.texImage2D(gl.TEXTURE_2D, 0, gl.RGBA, gl.RGBA, gl.UNSIGNED_BYTE, image);
        gl.texParameteri(gl.TEXTURE_2D, gl.TEXTURE_MAG_FILTER, gl.LINEAR);
        gl.texParameteri(gl.TEXTURE_2D, gl.TEXTURE_MIN_FILTER,  gl.LINEAR);

        gl.generateMipmap(gl.TEXTURE_2D);
        gl.bindTexture(gl.TEXTURE_2D, null);
        return texture;
    }

    // constructor for Cubes
    Cube = function Cube(name, position, size, color) {
        this.name = name;
        this.position = position || [0,0,0];
        this.size = size || 1.0;
        this.color = color || [.7,.8,.9];
        this.totalDelta = 0;
        this.cycle = 1;//First segement
        this.texture = undefined;
    };
    Cube.prototype.init = function(drawingState) {
        var gl=drawingState.gl;
        // create the shaders once - for all cubes
        if (!shaderProgram) {
            shaderProgram = twgl.createProgramInfo(gl, ["roundhouse-vs", "roundhouse-fs"]);
        }

        this.texture = createGLTexture(gl,image, false);

        if (!buffers) {
            var arrays = {
                vpos : { numComponents: 3, data:vertexPosition},
                vnormal : {numComponents:3, data:normal},
                vTexCoor:{numComponents:2, data:textureCoord}
            };

            buffers = twgl.createBufferInfoFromArrays(drawingState.gl,arrays);
        }

    };
    Cube.prototype.draw = function(drawingState) {
        // we make a model matrix to place the cube in the world

        if (!this.lastTime) {
            this.lastTime = drawingState.realtime;
            return;
        }
        var delta = drawingState.realtime - this.lastTime;
        this.lastTime = drawingState.realtime;
        var speed = 10/6000;
        this.totalDelta += delta*speed;
        if (this.cycle == 1) {
            this.position[0] -= delta * speed;

            this.position[1] = Math.max(0, Math.sin(this.totalDelta/2));
            if (this.position[0] <= -3.5) {
                this.cycle += 1;
            }
        }else if (this.cycle == 2){
            this.position[2] -= delta* speed;
            if (this.position[2] <= -3){
                this.cycle += 1;
            }
        }else if (this.cycle ==3){
            this.position[2] += delta* speed;
            if (this.position[2]>= 3){
                this.cycle +=1;
            }
        }else if (this.cycle == 4){
            this.position[0] += delta* speed;
            if (this.position[0] >= 3){
                this.cycle = 1;
            }
        }


        var modelM = twgl.m4.multiply(twgl.m4.scaling([this.size,this.size,this.size]),twgl.m4.translation(this.position));
        // the drawing coce is straightforward - since twgl deals with the GL stuff for us
        var gl = drawingState.gl;
        gl.useProgram(shaderProgram.program);
        gl.bindTexture(gl.TEXTURE_2D, this.texture);
        twgl.setBuffersAndAttributes(gl,shaderProgram,buffers);
        twgl.setUniforms(shaderProgram,{
            view:drawingState.view, proj:drawingState.proj, lightdir:drawingState.sunDirection,
            cubecolor:this.color, dynamiclight:drawingState.dynamiclight, model: modelM });
        twgl.drawBufferInfo(gl, gl.TRIANGLES, buffers);
    };
    Cube.prototype.center = function(drawingState) {
        return this.position;
    }


    ////////
    // constructor for Cubes
    SpinningCube = function SpinningCube(name, position, size, color, axis) {
        Cube.apply(this,arguments);
        this.axis = axis || 'X';
    }
    SpinningCube.prototype = Object.create(Cube.prototype);
    SpinningCube.prototype.draw = function(drawingState) {
        // we make a model matrix to place the cube in the world
        var modelM = twgl.m4.scaling([this.size,this.size,this.size]);
        var theta = Number(drawingState.realtime)/200.0;
        if (this.axis == 'X') {
            twgl.m4.rotateX(modelM, theta, modelM);
        } else if (this.axis == 'Z') {
            twgl.m4.rotateZ(modelM, theta, modelM);
        } else {
            twgl.m4.rotateY(modelM, theta, modelM);
        }
        twgl.m4.setTranslation(modelM,this.position,modelM);


        // the drawing coce is straightforward - since twgl deals with the GL stuff for us
        var gl = drawingState.gl;
        gl.useProgram(shaderProgram.program);
        gl.bindTexture(gl.TEXTURE_2D, this.texture);
        twgl.setBuffersAndAttributes(gl,shaderProgram,buffers);
        twgl.setUniforms(shaderProgram,{
            view:drawingState.view, proj:drawingState.proj, lightdir:drawingState.sunDirection,
            cubecolor:this.color, model: modelM,dynamiclight:drawingState.dynamiclight });
        twgl.drawBufferInfo(gl, gl.TRIANGLES, buffers);
    };
    SpinningCube.prototype.center = function(drawingState) {
        return this.position;
    }


